pragma solidity ^0.4.23;
import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import 'openzeppelin-solidity/contracts/math/SafeMath.sol';

contract SimpleReservationMultipleWithdrawers is Ownable {
	using SafeMath for uint256;

	uint public maxAllowedWithdrawCyclesCount;

	struct ReservationStruct {
		address recipientAddress;
		uint256 reservationCostLOC;
		uint dateForWithdraw;
	}

	mapping (bytes32 => ReservationStruct) public reservations;
	ERC20 public LOCTokenContract;

	event LogCreateReservation(bytes32 indexed _reservationId, address indexed _customerAddress, address indexed _recipientAddress, uint _reservationEndDate, uint _reservationCostLOC);
	event LogWithdrawal(uint256 _withdrawedAmount, address indexed _withdrawerAddress);

	constructor(address _locTokenContractAddress, uint _maxAllowedCyclesCount) public {
		LOCTokenContract = ERC20(_locTokenContractAddress);
		maxAllowedWithdrawCyclesCount = _maxAllowedCyclesCount;
	}

	modifier onlyNotExisting(bytes32 _reservationId) {
		require(reservations[_reservationId].recipientAddress == address(0));
		_;
	}

	modifier validateCountCycle(bytes32[] _reservationsArray) {
		require(_reservationsArray.length <= maxAllowedWithdrawCyclesCount);
		_;
	}

	function setLOCTokenContractAddress(address _locTokenContractAddress) public onlyOwner {
		LOCTokenContract = ERC20(_locTokenContractAddress);
	}

	function validateWithdrawOrThrow(bytes32 _reservationId) internal view returns(bool success) {
		require(reservations[_reservationId].recipientAddress == msg.sender);
		require(now > reservations[_reservationId].dateForWithdraw);
		return true;
	}

	function setmaxAllowedWithdrawCyclesCount(uint _maxAllowedWithdrawCyclesCount) onlyOwner {
		maxAllowedWithdrawCyclesCount = _maxAllowedWithdrawCyclesCount;
	}

	function validateWithdraw(bytes32[] _reservationIds) public validateCountCycle(_reservationIds) view returns(bool success) {
		require(_reservationIds.length > 0);

		for (uint i = 0 ; i < _reservationIds.length ; i++) {
			validateWithdrawOrThrow(_reservationIds[i]);	
		}
		return true;
	}

	function createReservation(
		bytes32 _reservationId,
		uint256 _reservationCostLOC,
		uint _startDateForWithdrawal,
		address _recipientAddress
	) public onlyNotExisting(_reservationId) returns(bool success) {
		require(_reservationCostLOC > 0);
		require(now < _startDateForWithdrawal);

		reservations[_reservationId] = ReservationStruct({
			recipientAddress: _recipientAddress,
			reservationCostLOC: _reservationCostLOC,
			dateForWithdraw: _startDateForWithdrawal     
		});

		assert(LOCTokenContract.transferFrom(msg.sender, this, _reservationCostLOC));

		emit LogCreateReservation(_reservationId, msg.sender, _recipientAddress, _startDateForWithdrawal, _reservationCostLOC);
		return true;
	}

	function withdraw(bytes32[] _reservationIds) public validateCountCycle(_reservationIds) returns(bool success) {
		require(_reservationIds.length > 0);
		uint256 withdrawAmount;

		for (uint i = 0 ; i < _reservationIds.length ; i++) {
			bytes32 reservationId = _reservationIds[i];
			ReservationStruct currentReservation = reservations[reservationId];

			validateWithdrawOrThrow(reservationId);

			withdrawAmount = withdrawAmount.add(currentReservation.reservationCostLOC);
			currentReservation.reservationCostLOC = 0;
		}
		assert(LOCTokenContract.transfer(msg.sender, withdrawAmount));
		emit LogWithdrawal(withdrawAmount, msg.sender);
		return true;
	}
}
